        {/* Repeat or add more paragraphs as needed */}
      </main>
            {/* Footer with Back Button */}
      <footer className="mt-8 mb-4">
        <button className="bg-green-700 text-white px-6 py-2 rounded-full hover:bg-green-800">
          Back
        </button>
      </footer>
    </div>
  );
};

export default PrivacyPolicy;
